import React from 'react'
import { StyleSheet, Text, View } from 'react-native'

export default function Hr() {
    return (
        <View style={styles.ruler}>
        </View>
    )
}

const styles = StyleSheet.create({
    ruler: {
        borderBottomColor: '#303030',
        borderBottomWidth: 1
    }
})
